import './App.css';
import Home from './components/Home';
import AddClient from './components/client/AddClient';
import EditClient from './components/client/EditClient';
import ClientList from './components/client/ClientList';
import {Route} from 'react-router-dom';
import {Routes} from 'react-router-dom';
import Header from './components/Header';
import AddCommande from './components/commande/AddCommande';
import BookList from './components/Book/list';
import CategorieList from './components/categorie/CategorieList';
import AddCategorie from './components/categorie/AddCategorie';
import EditCategorie from './components/categorie/EditCategorie';
import NewBook from './components/Book/new';
import EditBook from './components/Book/edit';
import Content from './components/ResponsableStore/content/content';
function App(){
    return (


          <Routes>
          <Route path ='/' element ={<Home/>} />
          <Route path ='/admin' element ={<Content/>} />
          <Route path ='/Clients' element ={<ClientList/>} />
          <Route path ='/Clients/Add' element ={<AddClient/>} />
          <Route path ='/Clients/Edit/:idc' element ={<EditClient/>} />

          <Route path ='/Commande/Add' element ={<AddCommande/>}/>

          <Route path ='/Book' element ={<BookList/>}/>
          <Route path ='/Book/Add' element ={<NewBook/>}/>
          <Route path ='/Book/Edit/:idP' element ={<EditBook/>}/>

          <Route path ='/Categories' element ={<CategorieList/>}/>
          <Route path ='/Categories/Add' element ={<AddCategorie/>}/>
          <Route path ='/Categories/Edit/:idCateg' element ={<EditCategorie/>}/>

          </Routes>


    );
  }
  export default App;
